import styled from "styled-components";
import { ReactComponent as Logo } from '../../icons/logo-white.svg';
const MainWrapper = styled.div`
box-sizing: border-box;
position: relative;
height: 675px;
padding-top: 220px;
width: 1440px;
background-color: black;
z-index: -10;
`
const DataWrapper = styled.section`
overflow: hidden;
margin: 0 auto;
display: flex;
justify-content: space-between;
align-items: center;
width: 1112px;
`
const LogoBlock = styled.div`
display: flex;
align-items: center;
height: 100%;
`
const ButtonsBlock = styled.div`
display: flex;
align-items: center;
height: 100%;
color: white;
`
const Button = styled.button`
width: 108px;
height: 37px;
background-color: #3AD0E6;
border: none;
font-size: 13px;
font-weight: 600;
border-radius: 40px;
margin-left: 10px;
cursor: pointer;
:hover{
    background-color: #50dff5
}
`
const InfoBlock = styled.div`
font-weight: 500;
font-size: 14px;
margin-left: 10px;
`
const LogoIcon = styled.div`
height: 125px;
`
const TextBlock = styled.div`
font-weight: 700;
font-size: 14px;
line-height: 20px;
letter-spacing: 0.02em;
color: white;
span{
    font-weight: 700;
}
`

const Footer = () => {
    return (
        <MainWrapper>
            <DataWrapper>
                <LogoBlock>
                    <LogoIcon>
                        <Logo style={{ height: '100%' }} />
                    </LogoIcon>
                </LogoBlock>
                <ButtonsBlock>
                    <InfoBlock>Questions?</InfoBlock>
                    <InfoBlock>X-XXX-XXX-XXXX</InfoBlock>
                    <Button>Login In</Button>
                    <Button>Sign Up</Button>
                </ButtonsBlock>
                <TextBlock>




                </TextBlock>
            </DataWrapper>
        </MainWrapper>

    )
}
export default Footer;
